import React, { Component } from 'react'
import {Card,Button} from 'antd'

export default class Category extends Component {
    render() {
        const title =(
            <span>一级分类列表</span>,
            <Button>添加</Button>
        )
        return (
            <Card title={title}>
                
            </Card>
        )
    }
}
